import Grid from "@material-ui/core/Grid";
function TechColumns(prop) {
  return (
    <div>
      <h1>Languages</h1>
      <div className="tech_columns">
        <div className="tech_bullets">
          <ul>
            <li>JavaScript</li>
            <li>HTML</li>
            <li>CSS</li>
          </ul>
        </div>
        <div className="tech_bullets">
          <ul>
            <li>JavaScript</li>
